 <p class=x_680b7127><b><u>Dear Sleepless Mother,</u> 
</b><p class=x_680b7127><b><br></b><p class=x_680b7127>
<p class=x_680b7127>
<p class=x_680b7127><b>When was the last time your baby slept through the night... or fell asleep when you needed him to?
</b><p class=x_680b7127><b>Maybe you’ve tried all kinds of tips and tricks just to have your little one wake you up 5 times a night...<br></b><p class=x_680b7127><b>Now there’s finally hope...<br></b><p class=x_680b7127><b>Scientists from the Stanford Sleep Lab recently released an eye-opening report on 3 common mistakes most mothers make that make it almost impossible for your child to sleep...<br></b><p class=x_680b7127>
<p class=x_680b7127><b>And you're probably guilty of the #1 culprit right now...
</b><p class=x_680b7127>
<p class=x_680b7127> 
<p class=x_680b7127>
<p class=x_680b7127><b>Think you know what they are? <a href=http://bit.ly/2XbfB6q id=link-qos8tb1b00j class=url-link><span class=x_cf78bd4c><u>Click here to find out if you're right.</u></span></a></b>
<p class=x_680b7127><br></p>
